import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { LandingPage, NewReview} from './components'
import reportWebVitals from './reportWebVitals';
import { loadProducts } from './utils'
import { RouterProvider, createBrowserRouter } from 'react-router-dom'
import RootLayout from './routes/RootLayout'

//landing page
//add review modal
  // user clicks submit button
    //On success, should redirect back to the Product Review page with the newly added review on the top of the Review List On error, show the error message
//edit review modal
const router = createBrowserRouter([
  {path:'/', element: <RootLayout />,
children: [
  {path: '/', element: <LandingPage/>, loader: loadProducts},
  // {path: '/edit-review', element: <NewReview/>}

]}
])

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <RouterProvider router={router}/>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
